wwv_flow_api.create_authentication(
 p_id=>wwv_flow_api.id(45508889393287187633)
,p_name=>'login_mp'
,p_scheme_type=>'NATIVE_CUSTOM'
,p_attribute_03=>'mp_login'
,p_attribute_05=>'N'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'FUNCTION mp_login(p_username IN VARCHAR2, --User_Name ',
'                  p_password IN VARCHAR2 -- Password',
'                 )',
'RETURN BOOLEAN AS',
' lc_pwd_exit VARCHAR2 (1);',
' ',
'BEGIN',
' -- Validate whether the user exits or not',
' SELECT ''Y''',
' INTO lc_pwd_exit',
' FROM ',
'     ((SELECT',
'          ADMIN_ID,',
'          PASSWORD',
'      FROM',
'          mp_administrator)',
'      UNION',
'      (SELECT',
'          USER_ID,',
'          PASSWORD',
'      FROM',
'          MP_USER)) USERS',
' WHERE (UPPER(users.admin_id) = UPPER(p_username)',
'     AND UPPER(users.password) = UPPER(p_password));',
'',
'    RETURN TRUE;',
'    EXCEPTION',
'        WHEN NO_DATA_FOUND',
'            THEN',
'                RETURN FALSE;',
' END mp_login;'))
,p_invalid_session_type=>'LOGIN'
,p_use_secure_cookie_yn=>'N'
,p_ras_mode=>0
);
end;
